import './App.css';

const arrTask = ['Dentista', 'Salão de beleza', 'Manicure', 'Podologia'];


const Task = (value, dayTask) => {
  return (
    <div>
      <li>{value}</li>
      <li>{dayTask}</li>
    </div>
  );
}

function App(dayTask) {
  return (
    <div className="App">
      <p>{Task('Trybe')}</p>
      <ul>{dayTask}</ul>
    </div>
  );
}

export default App;
